import React, { Component } from 'react';

class ScheduleTime extends Component {

    constructor(props) {
        super(props);

        this.state = {
            schTime : '',
        }

      }


    componentDidMount() {


    Axios.get(`https://kido-bookt-backend-default-rtdb.firebaseio.com/groupContents/${this.props.location.state.groupId}/scheduleDate/${this.sdateId}/scheduleTime.json`)
    .then((response) => {
           console.log(response);
        this.setState({
            schTime: response.data
        })
    })
        .catch((error) => console.log(error));

    }

    render() {
        return (
            <>
            </>
        )
    }
}

export default ScheduleTime;
